  public class GRControl : System.Windows.Forms.Control
  {

    // Internal properties of this control.
    private System.ComponentModel.Container mComponents;
    private IntPtr mHDC;
    private bool mAttemptedInitialization;
    private int mTotalFramesDrawn;
    private GRPrecisionTimer mGRPrecisionTimer;
    private double mTotalElapsedTimeSeconds;
    private double mPreviousFrameStartTimeSeconds;
    private double mPreviousFrameDurationSeconds;
    private GR mGR;
    private IntPtr mHGLRC;





    private void Initialize ( )
    {
      this.mComponents = null;
      this.mHDC = IntPtr.Zero;
      this.mAttemptedInitialization = false;
      this.mTotalFramesDrawn = 0;
      this.mGRPrecisionTimer = new GRPrecisionTimer( );
      this.mGRPrecisionTimer.SetReferenceTimeToNow( );
      this.mTotalElapsedTimeSeconds = 0.0;
      this.mPreviousFrameStartTimeSeconds = 0.0;
      this.mPreviousFrameDurationSeconds = 0.0;
      this.mGR = new GR( );
      this.mHGLRC = IntPtr.Zero;
    }






    private void InitializeComponent ( )
    {
      // this.AutoScaleBaseSize = new System.Drawing.Size( 5, 13 );
      this.ClientSize = new System.Drawing.Size( 640, 480 );
      this.Name = "GRControl";
      this.Text = "GRControl";
    }


    public GRControl ( )
    {
      this.Initialize( );
      InitializeComponent( );
    }



    protected override void Dispose ( bool disposing )
    {
      if (true == disposing)
      {
        if (mComponents != null)
        {
          mComponents.Dispose( );
        }
      }
      base.Dispose( disposing );
    }










    public IntPtr GetHDC ( )
    {
      return (mHDC);
    }

    public IntPtr GetHGLRC ( )
    {
      return (mHGLRC);
    }

    public GR GetGR ( )
    {
      return (this.mGR);
    }

    public int GetTotalFramesDrawn ( )
    {
      return (this.mTotalFramesDrawn);
    }

    public double GetTotalElapsedTimeSeconds ( )
    {
      return (this.mTotalElapsedTimeSeconds);
    }

    public double GetPreviousFrameStartTimeSeconds ( )
    {
      return (this.mPreviousFrameStartTimeSeconds);
    }

    public double GetPreviousFrameDurationSeconds ( )
    {
      return (this.mPreviousFrameDurationSeconds);
    }




    // Multicast event for when OpenGL is first initialized
    public delegate void DelegateOpenGLStarted ( GRControl sender );
    public event DelegateOpenGLStarted OpenGLStarted = null;
    protected void InvokeOpenGLStarted ( )
    {
      if (null != this.OpenGLStarted)
      {
        this.OpenGLStarted( this );
      }
    }





    // Methods handled by this control itself; called by the operating system.
    // In many cases, when one of the following methods is called by the 
    // operating system, the method will call a corrsponding method to invoke
    // event handlers set by the client of this control.

    protected override void OnPaint ( System.Windows.Forms.PaintEventArgs e )
    {
      // UPDATE THE TIME
      this.mTotalFramesDrawn++;
      this.mTotalElapsedTimeSeconds = this.mGRPrecisionTimer.GetElapsedTimeSeconds( );
      this.mPreviousFrameDurationSeconds =
          (this.mTotalElapsedTimeSeconds - this.mPreviousFrameStartTimeSeconds);
      this.mPreviousFrameStartTimeSeconds = this.mTotalElapsedTimeSeconds;



      // Do not attempt to paint while in Visual Studio designer mode
      if ((true == DesignMode) || (false == mAttemptedInitialization))
      {
        e.Graphics.Clear( System.Drawing.Color.SteelBlue );
        // int fontHeight = 12;
        // int lineHeight = fontHeight + 8;
        // int lineX = 0;
        // int lineY = 0;
        // System.Drawing.Font font =
        //     new System.Drawing.Font( "Arial", fontHeight, System.Drawing.FontStyle.Bold );
        // System.Drawing.Brush brush = System.Drawing.Brushes.Black;
        // lineY = 6;
        // e.Graphics.DrawString( "GRControl", font, brush, lineX, lineY );
        // lineY += lineHeight;
        // e.Graphics.DrawString( "C# wrapper for OpenGL", font, brush, lineX, lineY );
        // lineY += lineHeight;
        // e.Graphics.DrawString( "colinfahey.com", font, brush, lineX, lineY );
        // lineY += lineHeight;

        if (true == DesignMode)
        {
          return;
        }
      }



      if (false == mAttemptedInitialization)
      {
        mAttemptedInitialization = true;

        this.mGRPrecisionTimer.SetReferenceTimeToNow( );
        this.mTotalElapsedTimeSeconds = 0.0;

        mGR.SupportInitializeOpenGL
        (
            this.Handle,
            ref this.mHDC,
            ref this.mHGLRC
        );

        mGR.wglMakeCurrent( this.mHDC, this.mHGLRC );

        this.InvokeOpenGLStarted( );

        base.OnPaint( e ); // Triggers Paint *event*; thus, our override gets called before the event

        return;
      }


      mGR.wglMakeCurrent( this.mHDC, this.mHGLRC );

      base.OnPaint( e ); // Triggers Paint *event*; thus, our override gets called before the event
    }





    protected override void OnPaintBackground ( System.Windows.Forms.PaintEventArgs pevent )
    {
      // Override System.Windows.Forms.Control.OnPaintBackground() method.
      // No GDI painting of background means no flicker in OpenGL rendering.            
    }



    protected override void OnMouseDown ( System.Windows.Forms.MouseEventArgs e )
    {
      this.Focus( );

      base.OnMouseDown( e ); // This will invoke any events connected to this window
    }

  }










  public sealed class GRPrecisionTimer
  {
    private bool mStarted;
    private long mCountsPerSecond;
    private long mStartCount;


    private void ClearAllFields ( )
    {
      this.mStarted = false;
      this.mCountsPerSecond = 0;
      this.mStartCount = 0;
    }


    public GRPrecisionTimer ( )
    {
      this.ClearAllFields( );
    }


    public void SetReferenceTimeToNow ( )
    {
      if (false == this.mStarted)
      {
        if (false == GRPrecisionTimer.Kernel32_QueryPerformanceFrequency( out this.mCountsPerSecond ))
        {
          // Failed
        }
        else
        {
          this.mStarted = true;
        }
      }

      if (true == mStarted)
      {
        GRPrecisionTimer.Kernel32_QueryPerformanceCounter( out this.mStartCount );
      }
    }



    public double GetElapsedTimeSeconds ( )
    {
      if (true == this.mStarted)
      {
        long currentCount = 0;
        GRPrecisionTimer.Kernel32_QueryPerformanceCounter( out currentCount );

        if (this.mCountsPerSecond > 0)
        {
          return ((double)(currentCount - this.mStartCount) / ((double)this.mCountsPerSecond));
        }
        else
        {
          return (0.0);
        }
      }

      return (0.0);
    }


    [System.Runtime.InteropServices.DllImport( "kernel32", EntryPoint = "QueryPerformanceFrequency" ),
    System.Security.SuppressUnmanagedCodeSecurity]
    [return: System.Runtime.InteropServices.MarshalAs( System.Runtime.InteropServices.UnmanagedType.Bool )]
    private
    static
    extern
    bool
    Kernel32_QueryPerformanceFrequency
    (
        out long countFrequency
    );


    [System.Runtime.InteropServices.DllImport( "kernel32", EntryPoint = "QueryPerformanceCounter" ),
    System.Security.SuppressUnmanagedCodeSecurity]
    [return: System.Runtime.InteropServices.MarshalAs( System.Runtime.InteropServices.UnmanagedType.Bool )]
    private
    static
    extern
    bool
    Kernel32_QueryPerformanceCounter
    (
        out long countValue
    );
  }











