  public struct GRTextureCoordinates2
  {
    public float mU;
    public float mV;

    public void Set ( float u, float v )
    {
      mU = u;
      mV = v;
    }
  }


  public struct GRTriangleVertex
  {
    public GRVector3 mPosition;
    public GRVector3 mNormal;
    public GRColorRGBA mColor;
    public GRTextureCoordinates2 mTextureCoordinates;
  }


  public struct GRTriangle
  {
    public bool mUseNormals;
    public bool mUseColors;
    public bool mUseTexture;
    public bool mUseShader;
    public GRTriangleVertex mA;
    public GRTriangleVertex mB;
    public GRTriangleVertex mC;
    public long mTextureGUID;
    public long mShaderGUID;

    public void Draw ( GR gr )
    {
      if (true == this.mUseTexture) gr.glEnable( GR.GL_TEXTURE_2D );

      gr.glBegin( GR.GL_TRIANGLES );

      // Specify tex, normal, color, then position
      if (true == mUseTexture) gr.glTexCoord2f( mA.mTextureCoordinates.mU, mA.mTextureCoordinates.mV );
      if (true == mUseNormals) gr.glNormal3f( mA.mNormal.mX, mA.mNormal.mY, mA.mNormal.mZ );
      if (true == mUseColors) gr.glColor4f( mA.mColor.mR, mA.mColor.mG, mA.mColor.mB, mA.mColor.mA );
      gr.glVertex3f( mA.mPosition.mX, mA.mPosition.mY, mA.mPosition.mZ );

      if (true == mUseTexture) gr.glTexCoord2f( mB.mTextureCoordinates.mU, mB.mTextureCoordinates.mV );
      if (true == mUseNormals) gr.glNormal3f( mB.mNormal.mX, mB.mNormal.mY, mB.mNormal.mZ );
      if (true == mUseColors) gr.glColor4f( mB.mColor.mR, mB.mColor.mG, mB.mColor.mB, mB.mColor.mA );
      gr.glVertex3f( mB.mPosition.mX, mB.mPosition.mY, mB.mPosition.mZ );

      if (true == mUseTexture) gr.glTexCoord2f( mC.mTextureCoordinates.mU, mC.mTextureCoordinates.mV );
      if (true == mUseNormals) gr.glNormal3f( mC.mNormal.mX, mC.mNormal.mY, mC.mNormal.mZ );
      if (true == mUseColors) gr.glColor4f( mC.mColor.mR, mC.mColor.mG, mC.mColor.mB, mC.mColor.mA );
      gr.glVertex3f( mC.mPosition.mX, mC.mPosition.mY, mC.mPosition.mZ );

      gr.glEnd( );

      if (true == this.mUseTexture) gr.glDisable( GR.GL_TEXTURE_2D );
    }
  }



