  public class GRTexture
  {
    private int mWidth;
    private int mHeight;
    private byte[] mRGBAData;
    private bool mUseMipMaps;
    private int mOpenGLTextureID;


    public int GetWidth ( )
    {
      return (this.mWidth);
    }

    public int GetHeight ( )
    {
      return (this.mHeight);
    }

    public byte[] GetRGBAData ( )
    {
      return (this.mRGBAData);
    }

    public int GetOpenGLTextureID ( )
    {
      return (this.mOpenGLTextureID);
    }

    private void ClearAllFields ( )
    {
      this.mWidth = 0;
      this.mHeight = 0;
      this.mRGBAData = null;
      this.mUseMipMaps = true;
      this.mOpenGLTextureID = 0;
    }

    public GRTexture ( )
    {
      this.ClearAllFields( );
    }

    public void DisposeOfTextureAndData ( GR gr )
    {
      if (0 != this.mOpenGLTextureID)
      {
        int[] textureIDArray = new int[1];
        textureIDArray[0] = this.mOpenGLTextureID;
        gr.glDeleteTextures
        (
          1,
          textureIDArray
        );

        this.mOpenGLTextureID = 0;
      }
      this.ClearAllFields( );
    }




    private void PrivateCreateOpenGLTextureUsingInternalWidthHeightAndRBGAData ( GR gr )
    {
      int[] textureIDArray = new int[1];
      gr.glGenTextures
      (
        1,
        textureIDArray
      );
      this.mOpenGLTextureID = textureIDArray[0];


      gr.glBindTexture
      (
        GR.GL_TEXTURE_2D,
        this.mOpenGLTextureID
      );

      if (true == this.mUseMipMaps)
      {
        gr.gluBuild2DMipmaps
        (
            GR.GL_TEXTURE_2D,      // target                    
            GR.GL_RGBA,            // internalFormat
            this.mWidth,           // width
            this.mHeight,          // height
            GR.GL_RGBA,            // format
            GR.GL_UNSIGNED_BYTE,   // type
            this.mRGBAData         // data
        );
      }
      else
      {
        gr.glTexImage2D
        (
            GR.GL_TEXTURE_2D,      // target
            0,                     // level
            GR.GL_RGBA,            // internalFormat
            this.mWidth,           // width
            this.mHeight,          // height
            0,                     // border
            GR.GL_RGBA,            // format
            GR.GL_UNSIGNED_BYTE,   // type
            this.mRGBAData         // data
        );
      }

      gr.glTexParameteri( GR.GL_TEXTURE_2D, GR.GL_TEXTURE_WRAP_S, GR.GL_REPEAT );
      gr.glTexParameteri( GR.GL_TEXTURE_2D, GR.GL_TEXTURE_WRAP_T, GR.GL_REPEAT );

      if (true == this.mUseMipMaps)
      {
        gr.glTexParameterf( GR.GL_TEXTURE_2D, GR.GL_TEXTURE_MIN_FILTER, GR.GL_LINEAR_MIPMAP_LINEAR );
      }
      else
      {
        gr.glTexParameterf( GR.GL_TEXTURE_2D, GR.GL_TEXTURE_MIN_FILTER, GR.GL_LINEAR );
      }

      gr.glTexParameterf( GR.GL_TEXTURE_2D, GR.GL_TEXTURE_MAG_FILTER, GR.GL_LINEAR );
    }





    public void CreateCheckerboardTexture ( GR gr, int width, int height )
    {
      this.DisposeOfTextureAndData( gr );

      int totalBytes = 0;
      totalBytes = ((width * 4) * height);

      this.mWidth = width;
      this.mHeight = height;
      this.mRGBAData = new byte[totalBytes];
      this.mUseMipMaps = true;

      int x = 0;
      int y = 0;
      int k = 0;
      byte val = 0;

      for (y = 0; y < height; y++)
      {
        for (x = 0; x < width; x++)
        {
          k = ((width * 4) * y) + (x * 4);

          val = 0;
          if (0 == (((x / 16) + (y / 16)) % 2)) val = 255;
          this.mRGBAData[k + 0] = val; // red
          this.mRGBAData[k + 1] = val; // green
          this.mRGBAData[k + 2] = val; // blue
          this.mRGBAData[k + 3] = 255; // opacity (255 == opaque)
        }
      }

      this.PrivateCreateOpenGLTextureUsingInternalWidthHeightAndRBGAData( gr );
    }






    public bool LoadTextureFromFile
        (
        GR gr,
        String filePathAndName,
        bool useMipMaps
        )
    {
      this.DisposeOfTextureAndData( gr );


      Bitmap bitmap = null;

      try
      {
        bitmap = new Bitmap( filePathAndName );
      }
      catch
      {
        return (false);
      }







      int totalBytes = 0;
      totalBytes = ((bitmap.Width * 4) * bitmap.Height);

      this.mWidth = bitmap.Width;
      this.mHeight = bitmap.Height;
      this.mRGBAData = new byte[totalBytes];
      this.mUseMipMaps = useMipMaps;



#if USE_UNSAFE_CODE_TO_COPY_PIXELS_FROM_BITMAP_TO_BUFFER
            unsafe
            {
                System.Drawing.Imaging.BitmapData bitmapData =
                  bitmap.LockBits
                    (
                    new System.Drawing.Rectangle( 0, 0, bitmap.Width, bitmap.Height ),
                    System.Drawing.Imaging.ImageLockMode.ReadOnly,
                    System.Drawing.Imaging.PixelFormat.Format32bppArgb
                    );

                byte* sourceARGB = (byte*)bitmapData.Scan0.ToPointer( );
                int sourceStride = bitmapData.Stride;
                int copyWidth = bitmapData.Width;
                int copyHeight = bitmapData.Height;
                int destinationStride = (this.mWidth * 4);

                // The source has the pixel (0,0) at the upper-left of the image.
                // The destination OpenGL texture has texel (0,0) at the lower-left
                // of the texture.

                // Copy the ARGB source to the destination RGBA buffer.
                int x = 0;
                int y = 0;
                int k = 0;
                int sourceLineStart = 0;
                int destinationLineStart = (destinationStride * (this.mHeight - 1));
                for (y = 0; y < copyHeight; y++)
                {
                    for (x = 0; x < copyWidth; x++)
                    {
                        k = (x * 4);
                        mRGBAData[destinationLineStart + k + 0] = sourceARGB[sourceLineStart + k + 1];
                        mRGBAData[destinationLineStart + k + 1] = sourceARGB[sourceLineStart + k + 2];
                        mRGBAData[destinationLineStart + k + 2] = sourceARGB[sourceLineStart + k + 3];
                        mRGBAData[destinationLineStart + k + 3] = sourceARGB[sourceLineStart + k + 0];
                    }
                    sourceLineStart += sourceStride;
                    destinationLineStart -= destinationStride;
                }

                bitmap.UnlockBits( bitmapData );
            }
#endif


      // The following is an alternative to using "unsafe" code to copy bytes
      // from the bitmap to a buffer.

      {

        int copyWidth = bitmap.Width;
        int copyHeight = bitmap.Height;
        int destinationStride = (this.mWidth * 4);

        // The source has the pixel (0,0) at the upper-left of the image.
        // The destination OpenGL texture has texel (0,0) at the lower-left
        // of the texture.

        // Copy the ARGB source to the destination RGBA buffer.
        Color color = Color.Black;
        int x = 0;
        int y = 0;
        int k = 0;
        int destinationLineStart = (destinationStride * (this.mHeight - 1));

        for (y = 0; y < copyHeight; y++)
        {
          for (x = 0; x < copyWidth; x++)
          {
            color = bitmap.GetPixel( x, y );
            k = (x * 4);
            mRGBAData[destinationLineStart + k + 0] = color.R;
            mRGBAData[destinationLineStart + k + 1] = color.G;
            mRGBAData[destinationLineStart + k + 2] = color.B;
            mRGBAData[destinationLineStart + k + 3] = (byte)255;
          }
          destinationLineStart -= destinationStride;
        }

      }





      bitmap.Dispose( );

      this.PrivateCreateOpenGLTextureUsingInternalWidthHeightAndRBGAData( gr );

      return (true);
    }



    public void SetAsActiveTexture ( GR gr )
    {
      // Do the following before any call to glEnable( GL_TEXTURE_2D ):
      gr.glBindTexture
      (
          GR.GL_TEXTURE_2D,
          this.mOpenGLTextureID
      );
    }



    public void SubmitModifiedInternalRGBADataToTexture ( GR gr )
    {
      gr.glBindTexture
      (
          GR.GL_TEXTURE_2D,
          this.mOpenGLTextureID
      );



      if (true == this.mUseMipMaps)
      {
        // Will this work?
        gr.gluBuild2DMipmaps
        (
            GR.GL_TEXTURE_2D,      // target                    
            GR.GL_RGBA,            // internalFormat
            this.mWidth,           // width
            this.mHeight,          // height
            GR.GL_RGBA,            // format
            GR.GL_UNSIGNED_BYTE,   // type
            this.mRGBAData         // data
        );
      }
      else
      {
        gr.glTexSubImage2D
        (
            GR.GL_TEXTURE_2D,      // target
            0,                     // level
            0,                     // xoffset
            0,                     // yoffset
            this.mWidth,           // width
            this.mHeight,          // height
            GR.GL_RGBA,            // format
            GR.GL_UNSIGNED_BYTE,   // type
            this.mRGBAData         // pixels
        );
      }

    }

  }















