    public Delegate GetDelegate ( String functionName, Type delegateType, ref bool foundFunction )
    {
      foundFunction = false;
      IntPtr intPtr = IntPtr.Zero;


      // OPENGL32.DLL
      intPtr = GR.Kernel32_GetProcAddress( this.mhModuleGL, functionName );
      if (IntPtr.Zero != intPtr)
      {
        foundFunction = true;
        return (System.Runtime.InteropServices.Marshal.GetDelegateForFunctionPointer( intPtr, delegateType ));
      }

      // GLU32.DLL
      intPtr = GR.Kernel32_GetProcAddress( this.mhModuleGLU, functionName );
      if (IntPtr.Zero != intPtr)
      {
        foundFunction = true;
        return (System.Runtime.InteropServices.Marshal.GetDelegateForFunctionPointer( intPtr, delegateType ));
      }

      // GDI32.DLL
      intPtr = GR.Kernel32_GetProcAddress( this.mhModuleGDI, functionName );
      if (IntPtr.Zero != intPtr)
      {
        foundFunction = true;
        return (System.Runtime.InteropServices.Marshal.GetDelegateForFunctionPointer( intPtr, delegateType ));
      }

      // OPENGL extension function (via wglGetProcAddress())
      intPtr = GR.OpenGL32_wglGetProcAddress( functionName );
      if (IntPtr.Zero != intPtr)
      {
        foundFunction = true;
        return (System.Runtime.InteropServices.Marshal.GetDelegateForFunctionPointer( intPtr, delegateType ));
      }

      // Failed to find a function
      return ((Delegate)null);
    }







    public void SupportInitializeOpenGL
    (
        IntPtr hwnd,  // in
        ref IntPtr hdc,   // out
        ref IntPtr hglrc  // out
    )
    {
      hdc = GR.User32_GetDC( hwnd );

      // CAUTION: Not doing the following wgl.wglSwapBuffers() on the DC will
      // result in a failure to subsequently create the RC.  WHY ? !
      GR.OpenGL32_wglSwapBuffers( hdc );

      hglrc = IntPtr.Zero;


      GR.PIXELFORMATDESCRIPTOR pfd = new GR.PIXELFORMATDESCRIPTOR( );

      pfd.nSize = 40; // sizeof(PIXELFORMATDESCRIPTOR); 
      pfd.nVersion = 1;
      pfd.dwFlags = (GR.PFD_DRAW_TO_WINDOW | GR.PFD_SUPPORT_OPENGL | GR.PFD_DOUBLEBUFFER); // | GR.PFD_SUPPORT_GDI  );
      pfd.iPixelType = (byte)(GR.PFD_TYPE_RGBA);
      pfd.cColorBits = 32;
      pfd.cRedBits = 0;
      pfd.cRedShift = 0;
      pfd.cGreenBits = 0;
      pfd.cGreenShift = 0;
      pfd.cBlueBits = 0;
      pfd.cBlueShift = 0;
      pfd.cAlphaBits = 0;
      pfd.cAlphaShift = 0;
      pfd.cAccumBits = 0;
      pfd.cAccumRedBits = 0;
      pfd.cAccumGreenBits = 0;
      pfd.cAccumBlueBits = 0;
      pfd.cAccumAlphaBits = 0;
      pfd.cDepthBits = 32;
      pfd.cStencilBits = 0;
      pfd.cAuxBuffers = 0;
      pfd.iLayerType = (byte)(GR.PFD_MAIN_PLANE);
      pfd.bReserved = 0;
      pfd.dwLayerMask = 0;
      pfd.dwVisibleMask = 0;
      pfd.dwDamageMask = 0;


      // Choose Pixel Format
      int pixelFormat = 0;
      pixelFormat = GR.GDI32_ChoosePixelFormat( hdc, ref pfd );
      if (0 == pixelFormat)
      {
        string message = "ChoosePixelFormat() failed";
        MessageBox.Show( null, message, "Error", MessageBoxButtons.OK );
        return;
      }


      // Set Pixel Format
      int resultSPF = 0;
      resultSPF = GR.GDI32_SetPixelFormat( hdc, pixelFormat, ref pfd );
      if (0 == resultSPF)
      {
        string message = "SetPixelFormat() failed";
        MessageBox.Show( null, message, "Error", MessageBoxButtons.OK );
        return;
      }


      // Create Rendering Context (RC)

      // NOTE: You will get the following error:
      //             126 : ERROR_MOD_NOT_FOUND
      // if you attempt to create a render context too soon after creating a
      // window and getting its Device Context (DC).
      // Calling wglSwapBuffers( hdc ) before attempting to create the RC
      // evidently solves this problem.

      hglrc = GR.OpenGL32_wglCreateContext( hdc );

      if (IntPtr.Zero == hglrc)
      {
        string message = "wglCreateContext() failed";
        MessageBox.Show( null, message, "Error", MessageBoxButtons.OK );
        return;
      }


      // Make the new Render Context (RC) the current Render Context (RC)
      int resultMC = 0;
      resultMC = GR.OpenGL32_wglMakeCurrent( hdc, hglrc );
      if (0 == resultMC)
      {
        string message = "wglMakeCurrent() failed";
        MessageBox.Show( null, message, "Error", MessageBoxButtons.OK );
        GR.OpenGL32_wglDeleteContext( hglrc );
        hglrc = IntPtr.Zero;
        return;
      }

      // Now that we have an OpenGL "Rendering Context", and the Rendering Context
      // is also CURRENT (for the window's Device Context), we can get the 
      // pointers of OpenGL functions suitable for this context.
      this.BuildFunctionListAssumingGLRCIsCurrent( );
    }



  }















