    // The following function may be called by SupportDrawModel() to
    // demonstrate the use of the OpenGL functions gl.glVertexPointer(), 
    // gl.glColorPointer(), and gl.glDrawElements().  Notice that the following
    // function is marked as "unsafe" due to its use of pointers.

    public static void SupportDrawCubeViaVertexArrays ( GR gr )
    {
      // The following code demonstrates drawing via vertex arrays.

      gr.glEnableClientState( GR.GL_VERTEX_ARRAY );
      gr.glEnableClientState( GR.GL_COLOR_ARRAY );


      gr.glVertexPointer
        (
        3,               // 'size'    : This is the number of values PER VERTEX; i.e., 3 (x,y,z), or 2 (x,y)
        GR.GL_FLOAT,     // 'type'    : The format of each value (e.g., float)
        0,               // 'stride'  : The memory gap between successive vertices
        mCubeXYZVertexArray  // 'pointer' : The pointer to an array of vertices
        );




      gr.glColorPointer
        (
        3,               // 'size'    : This is the number of values PER COLOR; i.e., 3 (r,g,b), or 4 (r,g,b,a)
        GR.GL_FLOAT,     // 'type'    : The format of each value (e.g., float)
        0,               // 'stride'  : The memory gap between successive colors
        mCubeTriangleVertexColorsRGBVertexArray  // 'pointer' : The pointer to an array of color values
        );




      gr.glDrawElements
        (
        GR.GL_TRIANGLES,    // This is the geometric primitive to render
        (mCubeTriangleFacesABCIndicesVertexArray.Length), // Total integers (not total groups of integers)
        GR.GL_UNSIGNED_INT, // GL_INT does not work!  Use GL_UNSIGNED_INT instead.
        mCubeTriangleFacesABCIndicesVertexArray     // pointer to the polygon vertex INDICES
        );


      gr.glDisableClientState( GR.GL_COLOR_ARRAY );
      gr.glDisableClientState( GR.GL_VERTEX_ARRAY );
    }








    public static void SupportDrawCubeViaCallPerVertex ( GR gr )
    {
      float[][] vertxyz = new float[8][]
            {
                new float[] { -100.0f, -100.0f, -100.0f },  // 0
                new float[] { -100.0f, -100.0f,  100.0f },  // 1
                new float[] { -100.0f,  100.0f, -100.0f },  // 2
                new float[] { -100.0f,  100.0f,  100.0f },  // 3
                new float[] {  100.0f, -100.0f, -100.0f },  // 4
                new float[] {  100.0f, -100.0f,  100.0f },  // 5
                new float[] {  100.0f,  100.0f, -100.0f },  // 6
                new float[] {  100.0f,  100.0f,  100.0f }   // 7
            };


      int[][] triabc = new int[12][]
            {
                new int[] {0,2,4}, new int[] {4,2,6}, // Back
                new int[] {0,4,1}, new int[] {1,4,5}, // Bottom
                new int[] {0,1,2}, new int[] {2,1,3}, // Left
                new int[] {4,6,5}, new int[] {5,6,7}, // Right
                new int[] {2,3,6}, new int[] {6,3,7}, // Top
                new int[] {1,5,3}, new int[] {3,5,7}  // Front
            };


      float[][] colorsrgb = new float[12][]
            {
                new float[] {0.5f,0.1f,0.1f }, new float[] {1.0f,0.1f,0.1f }, // Red
                new float[] {0.5f,0.5f,0.1f }, new float[] {1.0f,1.0f,0.1f }, // Yellow
                new float[] {0.1f,0.5f,0.1f }, new float[] {0.1f,1.0f,0.1f }, // Green
                new float[] {0.1f,0.5f,0.5f }, new float[] {0.1f,1.0f,1.0f }, // Cyan
                new float[] {0.1f,0.1f,0.5f }, new float[] {0.1f,0.1f,1.0f }, // Blue
                new float[] {0.5f,0.1f,0.5f }, new float[] {1.0f,0.1f,1.0f }  // Magenta
            };


      int triTotal = 12;
      int triIndex = 0;


      gr.glBegin( GR.GL_TRIANGLES );
      for (triIndex = 0; triIndex < triTotal; triIndex++)
      {
        gr.glColor3fv( colorsrgb[triIndex] );
        gr.glVertex3fv( vertxyz[triabc[triIndex][0]] );

        gr.glColor3fv( colorsrgb[triIndex] );
        gr.glVertex3fv( vertxyz[triabc[triIndex][1]] );

        gr.glColor3fv( colorsrgb[triIndex] );
        gr.glVertex3fv( vertxyz[triabc[triIndex][2]] );
      }
      gr.glEnd( );
    }













    public static void SupportDrawTextUsingPolygonFont
    (
        GR gr,
        int fontOpenGLDisplayListBaseIndex,
        int clientWidth,
        int clientHeight,
        int fontHeightPixels,
        int textX,
        int textY,
        String text
    )
    {
      int stringLength = 0;
      int stringCharacterIndex = 0;
      int ASCIICharacter = 0;


      // Change rendering conditions
      gr.glDisable( GR.GL_DEPTH_TEST );
      gr.glDisable( GR.GL_CULL_FACE );


      // Preserve current matrices, and switch to an orthographic view, and 
      //   do scaling and translation as necessary.
      gr.glMatrixMode( GR.GL_PROJECTION );
      gr.glPushMatrix( );
      gr.glMatrixMode( GR.GL_MODELVIEW );
      gr.glPushMatrix( );


      gr.glMatrixMode( GR.GL_PROJECTION );
      gr.glLoadIdentity( );
      gr.glOrtho
      (
          (double)0,
          (double)(clientWidth - 1),
          (double)0,
          (double)(clientHeight - 1),
          -1.0,
          1.0
      );

      gr.glMatrixMode( GR.GL_MODELVIEW );
      gr.glLoadIdentity( );


      gr.glRasterPos2i( textX, textY ); // Only affects by BITMAP fonts:


      // Only affects POLYGON fonts:
      gr.glTranslatef( (float)(textX), (float)(textY), 0.0f );
      gr.glScalef( (float)fontHeightPixels, (float)fontHeightPixels, 1.0f );


      // Call a display list for each character to be rendered.  The ASCII code
      // is used as the display list number (of the 256 display lists for this
      // font), which is added to the base number of the set of display list
      // indices.

      stringLength = text.Length;
      for
      (
          stringCharacterIndex = 0;
          stringCharacterIndex < stringLength;
          stringCharacterIndex++
      )
      {
        ASCIICharacter = (int)(text[stringCharacterIndex]);
        gr.glCallList( fontOpenGLDisplayListBaseIndex + ASCIICharacter );
      }


      // Restore original matrices.
      gr.glMatrixMode( GR.GL_MODELVIEW );
      gr.glPopMatrix( );
      gr.glMatrixMode( GR.GL_PROJECTION );
      gr.glPopMatrix( );


      // Restore rendering conditions
      gr.glFrontFace( GR.GL_CCW ); // MUST DO AFTER USING wglUseFontOutlines LISTS!!!
      gr.glEnable( GR.GL_DEPTH_TEST );
      gr.glEnable( GR.GL_CULL_FACE );
    }








    public static void SupportCreateBitmapFont
    (
        GR gr,
        IntPtr hdc,  // [in]
        String fontName, // [in] "Verdana", "Arial", "Courier New", "Symbol", "Wingdings", "Wingdings 3"
        int bitmapFontOpenGLDisplayListBase  // [in]
    )
    {
      // IT IT AN ABSOLUTE NECESSITY TO SELECT A FONT IN TO THE DC FOR THE 
      // wglUseFontOutlines() METHOD TO SUCCEED WITHOUT A MYSTERIOUS 
      // ERROR 126: ERROR_MOD_NOT_FOUND : The specified module could not be found.
      // THAT ERROR CODE, OF COURSE, IS MISLEADING.

      System.Drawing.Font font =
        new System.Drawing.Font
          (
          fontName, // family: "Verdana", "Arial", "Courier New", "Symbol", "Wingdings", "Wingdings 3"
          9.0f,            // emSize: Font size (in points, due to flag in 4th parameter)
          System.Drawing.FontStyle.Regular, // style
          System.Drawing.GraphicsUnit.Point, // unit
          ((System.Byte)(0)) // GDI character set
          );


      IntPtr fontH = font.ToHfont( );

      GR.GDI32_SelectObject( hdc, fontH );


      int result = 0;

      result =
          gr.wglUseFontBitmapsA // Use wglUseFontBitmapsW() instead if this doesn't work!!!
          (
              hdc,
              0,
              255,
              bitmapFontOpenGLDisplayListBase
          );

      if (0 == result)
      {
        String message = "wglUseFontBitmaps() error";
        MessageBox.Show( null, message, "Error", MessageBoxButtons.OK );
      }
    }








    public static void SupportCreatePolygonFont
    (
        GR gr,
        IntPtr hdc,   // [in]
        String fontName,  // [in] "Verdana", "Arial", "Courier New", "Symbol", "Wingdings", "Wingdings 3"
        ref int polygonFontOpenGLDisplayListBase  // [out]
    )
    {
      polygonFontOpenGLDisplayListBase = gr.glGenLists( 256 );


      // IT IT AN ABSOLUTE NECESSITY TO SELECT A FONT IN TO THE DC FOR THE 
      // wglUseFontOutlines() METHOD TO SUCCEED WITHOUT A MYSTERIOUS 
      // ERROR 126: ERROR_MOD_NOT_FOUND : The specified module could not be found.
      // THAT ERROR CODE, OF COURSE, IS MISLEADING.

      System.Drawing.Font font =
        new System.Drawing.Font
          (
          fontName, // family: "Verdana", "Arial", "Courier New", "Symbol", "Wingdings", "Wingdings 3"
          1.0f, // IRRELEVANT FOR POLYGON FONT; emSize: Font size (in points, due to flag in 4th parameter)
          System.Drawing.FontStyle.Regular, // style
          System.Drawing.GraphicsUnit.Point, // unit
          ((System.Byte)(0)) // GDI character set
          );


      IntPtr fontH = font.ToHfont( );

      GR.GDI32_SelectObject( hdc, fontH );


      GR.GLYPHMETRICSFLOAT[] agmf = new GR.GLYPHMETRICSFLOAT[256];

      int result = 0;

      result =
        gr.wglUseFontOutlinesA // Use wglUseFontOutlinesW() instead if this doesn't work!!!
        (
          hdc,        // DC with font   
          0,                     // Starting Character
          255,                   // Number Of Display Lists To Build
          polygonFontOpenGLDisplayListBase, // Starting Display List index
          0.0f,                  // Deviation From The True Outlines
          0.15f,                 // Font Thickness In The Z Direction (Extrusion)
          GR.WGL_FONT_POLYGONS, // Format: GR.WGL_FONT_LINES, GR.WGL_FONT_POLYGONS
          agmf                   // Metrics pointer
        );

      if (0 == result)
      {
        String message = "wglUseFontOutlines() error";
        MessageBox.Show( null, message, "Error", MessageBoxButtons.OK );
      }
    }











    public static void SupportShaderProgramCreate
    (
        GR gr,
        String vertexShaderSource,
        String fragmentShaderSource,
        ref int shaderProgramHandle
    )
    {
      shaderProgramHandle = 0;

      if (false == gr.bglCreateProgramObjectARB)
      {
        return;
      }

      shaderProgramHandle = gr.glCreateProgramObjectARB( );




      int vertexShaderObjectHandle = 0;
      if (vertexShaderSource.Length > 0)
      {
        vertexShaderObjectHandle = gr.glCreateShaderObjectARB( GR.GL_VERTEX_SHADER_ARB );

        String[] vertexShaderSourceStringArray = null;
        vertexShaderSourceStringArray = new String[1];
        vertexShaderSourceStringArray[0] = vertexShaderSource;

        gr.glShaderSourceARB( vertexShaderObjectHandle, 1, vertexShaderSourceStringArray, null );
        gr.glCompileShaderARB( vertexShaderObjectHandle );
        gr.glAttachObjectARB( shaderProgramHandle, vertexShaderObjectHandle );
      }

      int fragmentShaderObjectHandle = 0;
      if (fragmentShaderSource.Length > 0)
      {
        fragmentShaderObjectHandle = gr.glCreateShaderObjectARB( GR.GL_FRAGMENT_SHADER_ARB );

        String[] fragmentShaderSourceStringArray = null;
        fragmentShaderSourceStringArray = new String[1];
        fragmentShaderSourceStringArray[0] = fragmentShaderSource;

        gr.glShaderSourceARB( fragmentShaderObjectHandle, 1, fragmentShaderSourceStringArray, null );
        gr.glCompileShaderARB( fragmentShaderObjectHandle );
        gr.glAttachObjectARB( shaderProgramHandle, fragmentShaderObjectHandle );
      }


      // Link the program 
      gr.glLinkProgramARB( shaderProgramHandle );




      // EXAMPLE OF USE:
      //
      // Set as active shader:
      // 
      //   gr.glUseProgramObjectARB( shaderProgramHandle );
      //
      // Setting uniforms for the active shader:
      //
      //   int shaderVarX = 0;
      //   shaderVarX = gr.glGetUniformLocation( shaderProgramHandle, "VarX" );
      //   gr.glUniform1f( shaderVarX, 4.0f );
    }





    public static void SupportShaderProgramSelect ( GR gr, int shaderProgramHandle )
    {
      if (true == gr.bglUseProgramObjectARB)
      {
        gr.glUseProgramObjectARB( shaderProgramHandle );
      }
    }








